import React from 'react'

class WeatherTile extends React.Component {
  constructor(props) {
    super(props)
  }
  render() {
    return(
      <div className="tile">
        <div className="weatherIco">
          <h3>{props.main}</h3>
        </div>
      </div>
    )
  }
}
